script: |
  super -f text -I q1950.spq | sort > q1950.out

inputs:
  - name: q1950.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 IN ( - col2 * - col1, - 64 * ( ( - col0 ) ), - + col2 * 39 );
  - name: tab1

outputs:
  - name: q1950.out
    data: |
      51	14	96
      85	5	59
      91	47	68
